import './App.css';
import 'bootstrap/dist/css/bootstrap.min.css';

import NavbarComponent from './customComponents/NavbarComponent';

function App() {
  return (
    <>
      <NavbarComponent 
                navLinks={[
                    { title: 'Home', href: '#home' },
                    { title: 'About', href: '#about' },
                    { title: 'About', href: '#about' },
                ]}
            />
    </>
  );
}

export default App;
